/** @format */

import styled from "styled-components";

export const TitleContainer = styled.div`
  color: white;
  textalign: center;
  -webkit-text-stroke-width: 1px;
  -webkit-text-stroke-color: black;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;
